import Footer from "../components/Footer";
import Header from "../components/Header";

const PocetnaPage = () => {
  return (
    <>
      <Header />
      <main>
        <h1>Dobrodošli na moju portofolio Web stranicu.</h1>
        <h2>
          Ja sam Dino Macić, Junior Frontend Developer. Na ovoj stranici mozete
          pronaci neke od mojih najzanimljivijih projekata i ostale informacije
          o meni.
        </h2>
      </main>
      <Footer />
    </>
  );
};

export default PocetnaPage;
